By the CYK algorithm, we find

Length‑1 cells:
1: {NT14, NT24, NT8}  
2: {NT19}  
3: {NT5, NT55}  
4: {NT10}  
5: {NT96}  
6: {NT18}  
7: {NT6}  
8: {NT60, NT95, NT81}  
9: {NT60, NT72}  
10:{NT54, NT2}

…and so on. In particular

• cell(1,3) (covering t2 t0 t5) contains NT29 via NT29→NT14 NT86 (with NT14 generating t2, NT86 spanning t0 t5).  
• cell(4,7) (covering t96 t67 t66 t74 t94 t49 t64) contains NT9 via NT9→NT10 NT17 (NT10→t96 and NT17 spanning the rest).  
• Finally cell(1,10) contains S via S→NT29 NT9.

Hence the start symbol S derives the entire string.

Yes
